 (4044,1951,'03_06 Read Holding and Write Single',1,'MODBUS_CO2_FORCED_RE-CALIBRATION','16 Bit Unsigned Integer','Locate the device in an environment with air having a stable CO2 concentration in the range of 400 ppm to 2000 ppm. 
1. Setting and controlling a known CO2 concentration in a sealed environment with the set CO2concentration acting as the reference value for FRC .
